== 简介 ==
「'''キャットフード'''」（Cat Food）是P主doriko在2010年11月17日投稿的由[[初音未来]]演唱的原创曲，也是doriko自热门曲「[[罗密欧与辛德瑞拉]]」之后一年的首次投稿。

doriko偏向pop风的作品，内容主要描写的是一个性格如同小猫一般的女孩。曲子用着弹跳欢快的旋律，描述着女孩时怒时喜的心境，和率直却又娇憨可爱的性格。

欢快的旋律加上PV中的[[猫耳]]风帽为曲子加分不少，也是doriko为数不多的风格很少女的作品。

